import React, {Component, useState} from 'react'
import Render from '../components/Render'
import PropTypes, { nominalTypeHack } from 'prop-types'
import Navbar from '../components/Navbar'
import './styles/app.css'
import InfoLogin from '../components/InfoLogin'
import Logo from '../images/logo.png'

//class App extends InfoLogin {}

class App extends InfoLogin{
  static propTypes = {
    children: PropTypes.object.isRequired
  };
  
  render () {
    const { children } = this.props;
    const local = localStorage.getItem('logueado');
    return (
      <div>
        <div className={this.state.load == true ? 'no' : 'si'} >
          {/* <Navbar dataUser={this.state.data}/> */}
              <Navbar />
              <Render body={children} />
          {/* <Footer /> */}
        </div>
        <div className={this.state.load == true ? 'si' : 'no'} >

            <div className="container-loader full-height mt-0 pt-0">
            <div className="absolute-center">
            <div className="text-center pt-0 mx-auto">

             <strong className="sr-only">Cargando...</strong>
              <div className="spinner-border ml-auto custom-size" role="status" aria-hidden="true">
                <img src={Logo} className="custom-size-2"/>
                </div>

            </div>
            </div>
            </div>

        </div>
      </div>
    );
  }
}

export default App;
